import React from "react";
import { Link } from 'react-router-dom'

const CardGames = ({ game }) => {
  return (
    <div className="card">
      <Link>
      <img src={game.background_image} alt="" />
      <div className="titleygenres">
        <h1>{game.name}</h1>
        {game.genres.map(genre => <p key={genre.id}>
         { genre.name}
        </p>)}
      </div>
      </Link>
      
    </div>
  );
};

export default CardGames;
